import React from 'react';
import Header from '../components/Header';

class Search extends React.Component {
  constructor() {
    super();

    this.state = {
      value: '',
    };
  }



  render() {
    return (
      <>
        <Header />
        <form id="search-form">
          <input
            id="input-search"
            name="value"
            type="text"
            placeholder="Nome do Artista"
          />
          <button
            type="button"
            id="button-search"
          >
            Pesquisar
          </button>
        </form>
      </>
    );
  }
}

export default Search;
